import school from '../Assets/image/schoolF.jpg'

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        {/* Left side image */}
        <a className="navbar-brand" href="#">
          <img src={school} alt="Logo" height="30" />
        </a>

        {/* Right side content */}
        <div className="d-flex flex-column">
          <h1 className="text-center">Main Heading</h1>
          <h2 className="text-center">Subheading</h2>
          <p className="text-center">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla
            viverra purus vitae risus vestibulum fermentum. Donec interdum
            facilisis justo, eu dignissim nibh fringilla in.
          </p>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
